import { useState, useEffect } from 'react';
import './Women.css'
import Display from '../../Extras/Display';

function Women() {

  const [products, setProducts] = useState([])
useEffect(() => {
  fetch("https://fakestoreapi.com/products")
  .then(res => res.json())
  .then(data => setProducts(data.data))
}, [])

  return (
    <h1>Hello World</h1>
    )
  }
export default Women;
